import React from "react";
import { connect } from "react-redux";
import { Form, Field } from "react-final-form";
import { setMessage } from "../reducers/contactReducer";
import {
  required,
  isEmail,
  composeValidators,
} from "../utils/formValidatorHelper";
import FinalFormField from "../Shared/FinalFormField";

const Contact = ({ setMessage }) => {
  const onSubmit = (values) => {
    setMessage(values);
  };

  return (
    <>
      <h1 className="f24 bold mt16 mb16">Contact Us</h1>
      <div className="r bs-3 bg-1 p20 mb20">
        <Form
          onSubmit={onSubmit}
          render={({ handleSubmit, rest }) => (
            <form onSubmit={handleSubmit}>
              <FinalFormField
                label={"Design Period"}
                fieldName={"planningAndDesign"}
                type={CONSTANTS.TYPES.DEVELOPER}
                validators={[required, minValue(0)]}
                placeholder={"Design Period"}
                fieldType={"number"}
                step={1}
                append={"mths"}
                parseType={CONSTANTS.PARSETYPE.INT}
              />
            </form>
          )}
        />
      </div>
    </>
  );
};

const mapStateToProps = (state) => {
  return {
    isFetching: state.contact.isFetching,
  };
};

const mapDispatchToProps = {
  setMessage,
};

export default connect(mapStateToProps, mapDispatchToProps)(Contact);
